import Container from "react-bootstrap/Container";
import {Col, Row, Form, Button} from "react-bootstrap";
import {useState} from "react";


function Chat() {

    const [prompt, setPrompt] = useState('');

    const generateChat = ()=> {
        console.log("Generating chat...");
    }
    return (
        <>
            <Container>
                <Row>
                    <Col>
                        <Form.Group className="mb-3" controlId="formGroupChat">
                            <Form.Label>Chat with me, ask me anything.</Form.Label>
                            <Form.Control value={prompt} type="text" placeholder="Enter any chat"/>
                        </Form.Group>
                        <div className="d-grid gap-1">
                            <Button
                                variant="outline-primary"
                                type="submit"
                                className="m-1"
                                onClick={generateChat}>
                                Generate
                            </Button>
                        </div>
                    </Col>
                </Row>
            </Container>
        </>
    )
}


export default Chat;
